import React from "react";

function TasksList({ tasks, deleteTask }){
    return (
        <ul>
        {tasks.map(task => (
          <li key = {task.id}>{task.text}<button onClick = {() => deleteTask(task.id)}>Delete</button></li>
        ))
        }
      </ul>
    )
}

export default TasksList;
